import React, { useState } from 'react';
import { Navbar, Nav, Container, Button } from 'react-bootstrap';
import GreenTrendz from '../assets/img/logo_1.png';
import logo from '../assets/img/logo.png';
import HomePage from '../HomePage'; // If HomePage.js is in the parent directory
import { Link } from 'react-router-dom';


const styles = {
    container: {
        maxWidth: '400px',
        margin: '50px auto',
        padding: '20px',
        border: '1px solid #ddd',
        borderRadius: '10px',
        boxShadow: '0 4px 8px rgba(0,0,0,0.1)',
        backgroundColor: '#fff',
    },
    title: {
        textAlign: 'center',
        marginBottom: '20px',
        color: '#333',
        fontSize: '24px',
        fontWeight: 'bold',
    },
    introText: {
        textAlign: 'center',
        marginBottom: '20px',
        color: '#666',
        fontSize: '16px',
    },
    form: {
        display: 'flex',
        flexDirection: 'column',
    },
    inputGroup: {
        marginBottom: '15px',
    },
    label: {
        marginBottom: '5px',
        fontWeight: 'bold',
        display: 'block',
        color: '#555',
    },
    input: {
        width: '100%',
        padding: '10px',
        borderRadius: '5px',
        border: '1px solid #ccc',
        fontSize: '16px',
    },
    button: {
        width: '100%',
        padding: '10px',
        borderRadius: '5px',
        backgroundColor: '#28a745',
        color: '#fff',
        fontSize: '16px',
        border: 'none',
        cursor: 'pointer',
    },
    newUserText: {
        textAlign: 'center',
        marginTop: '15px',
        color: '#555',
        fontSize: '14px',
    },
    link: {
        color: '#28a745',
        textDecoration: 'none',
        fontWeight: 'bold',
    },
};

const LoginPage = () => {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    const handleLogin = (e) => {
        e.preventDefault();
        console.log('Login clicked with email:', email, 'and password:', password);
    };

    return (
        <div>
            <header>
                <Navbar bg="light" expand="lg" className="shadow-sm py-3 custom-navbar">
                    <Container>
                        <Navbar.Brand href="#" className="d-flex align-items-center">
                            <img
                                src={GreenTrendz}
                                alt="Logo"
                                width="50"
                                height="50"
                                className="d-inline-block align-top me-2"
                            />
                            <span className="brand-text">GreenTrendz</span>
                        </Navbar.Brand>
                        <Navbar.Toggle aria-controls="basic-navbar-nav" />
                        <Navbar.Collapse id="basic-navbar-nav">
                            <Nav className="ms-auto d-flex align-items-center">
                                <Nav.Link href="#services" className="nav-link-enhanced">
                                    Services
                                </Nav.Link>
                                <Nav.Link href="#about" className="nav-link-enhanced">
                                    About Us
                                </Nav.Link>
                                <Nav.Link href="#contact" className="nav-link-enhanced">
                                    Contact
                                </Nav.Link>

                                <Routes>
                                    <Route path="/" element={<LoginPage />} />
                                    <Route path="/HomePage" element={<HomePage />} />
                                </Routes>



                            </Nav>
                        </Navbar.Collapse>
                    </Container>
                </Navbar>
            </header>

            <div style={styles.container}>
                <h1 style={styles.title}>Login</h1>
                <p style={styles.introText}>
                    Welcome back! Please enter your login details below to access your account.
                </p>
                <form style={styles.form} onSubmit={handleLogin}>
                    <div style={styles.inputGroup}>
                        <label htmlFor="email" style={styles.label}>
                            Email
                        </label>
                        <input
                            type="email"
                            id="email"
                            value={email}
                            onChange={(e) => setEmail(e.target.value)}
                            style={styles.input}
                            required
                        />
                    </div>
                    <div style={styles.inputGroup}>
                        <label htmlFor="password" style={styles.label}>
                            Password
                        </label>
                        <input
                            type="password"
                            id="password"
                            value={password}
                            onChange={(e) => setPassword(e.target.value)}
                            style={styles.input}
                            required
                        />
                    </div>
                    <button type="submit" style={styles.button}>
                        Login
                    </button>
                </form>
                <p style={styles.newUserText}>
                    New user? <a href="/SignUp" style={styles.link}>Create an account</a>
                </p>
            </div>
        </div>
    );
};

export default LoginPage;
